    [],nt"num_tags": 4,nt"name": "ninepipe-national-wildlife-refuge-annual-narrative-report-calendar-year-1979",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Ninepipe
    National Wildlife Refuge outlines Refuge accomplishments during the 1979 calendar
    year. The report begins with an introduction to the Refuge and describes climate
    and habitat conditions. Refuge maintenance is also described. Habitat management
    is covered; grasslands and wetlands are discussed. The wildlife section of the report
    discusses endangered and threatened species and migratory birds. Interpretation
    and recreation activities are outlined; topics include information and interpretation,
    recreational uses, and law enforcement. Field investigations, cooperative programs,
    items of interest, and safety are discussed. Photographs and newspaper articles
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
